---
xcodebuild_arguments:
- "-workspace"
- GiniMobile.xcworkspace
- "-scheme"
- GiniHealthAPILibrary
author: Gini GmbH
author_url: https://gini.net
module: GiniHealthAPILibrary
readme: README.md
theme: Documentation/jazzy-theme/
output: Documentation/Api
github_url: https://github.com/gini/gini-mobile-ios.git
hide_documentation_coverage: 'true'
documentation: Documentation/source/*.md
abstract: Documentation/sections/*.md
custom_categories:
- name: Documentation
  children:
  - Installation
  - Getting started
  - License
- name: Classes
  children: []
- name: Enums
  children: []
- name: Extensions
  children:
  - Array
  - Collection
- name: Protocols
  children: []
- name: Structs
  children: []
- name: Typealiases
  children: []

